import React from "react";

const RecentPractice =()=>{

    const imgs = [
        '../../img/ppt1.png',
        '../../img/ppt2.png',
        '../../img/ppt3.png',
        '../../img/ppt4.png',
        '../public/logo192.png'
    ];

    return(
        <>
        <div class="container-fluid pt-4 px-4"> 
            <div class="h-100 bg-light rounded p-4">
                
                <h6 class="mb-0">최근 연습</h6>
                <div class="scroll-container">
                    {imgs.map((path, index) => (
                        <div key={index} class="scroll-time-recent">
                            <button>
                                <img src={path} class="d-block mx-auto" alt={`이미지 ${index + 1}`} />
                            </button>
                        </div>
                    ))}
                </div>
            </div>
        </div>
        </>
    );
};

export default RecentPractice;
